class GetAllDoc{
    async allDoc(){
        await fetch(
            `users/alldoctors`
          ) .then((respone) => respone.json())
          .then((Result) => {
              var alldoctors=JSON.stringify(Result.data);
              var name,email,cnic,address="";
              var i=0;
              for (i in Result.data) {
                name = Result.data[i].fname;
                name += " " + Result.data[i].lname;
                name = Result.data[i].email;
                name = Result.data[i].cnic;
                name = Result.data[i].fname;
                console.log(name);
              }
              return console.log(alldoctors)
          })
    }

}


 export default new GetAllDoc();
